import logo from "./logo.svg";
import "./App.css";
import PhotoPage from "./components/PhotoPage";

function App() {
  return (
    <div style={{ padding: "0 4%" }}>
      <div>
        <span>Everyone's photos</span>

        <span>View all 2,724,700</span>
      </div>
      <PhotoPage />
    </div>
  );
}

export default App;
